import { React, useState } from "react";
import { useParams } from "react-router-dom";

const MovieCards = () => {
  const { q } = useParams();
  const [movies, setMovies] = useState({});

  function fetchMovie() {
    fetch(`http://omdbapi.com/?apikey=470179fa&s=${q}`)
      .then((response) => response.json)
      .then((data) => {
        console.log(data);
      });
  }

  fetchMovie();
  return <div></div>;
};

export default MovieCards;
